import React, { Component } from "react";

import Navigation from "./Components/Navigation";
import LandingPage from "./Components/LandingPage";
import Watches from "./Components/Watches";

export class App extends Component {
  render() {
    return (
      <div>
        <Navigation />
        <LandingPage />
        <Watches />
      </div>
    );
  }
}

export default App;
